const Meet = class Meet {

  // Abrir/Cerrar Chat
  static toggleChatPanel() {
    const chatButtonPanel = document.querySelector('button[jsname="A5il2e"][data-panel-id="2"]')
    chatButtonPanel.click()
  }

  // Si el chat se ha abierto anteriormente, se queda cargado aunque se cierre, por lo que su contenido es accesible
  static async sendMessage(message) {
    const chatArea = document.querySelector('[jsname="vERSO"] textarea')
    chatArea.value = message
    // const sendButton = document.querySelector('[jsname="SoqoBf"]')
    // sendButton.disabled = false

    // sendButton.click()

    const enterKeyCode = 13
    chatArea.dispatchEvent(new KeyboardEvent('keydown', {keyCode: enterKeyCode, bubbles: true}))

    const selectorMessage = `[jsname="Ypafjf"]:last-child .oIy2qc:not(.gYckH)[jsname="dTKtvb"][data-message-text="${message}"]`
    return waitForSelector(selectorMessage)
  }

  static get chatMessagesContainer() {
    return waitForSelector('[jsname="xySENc"]')
  }

  static get chatMessages() {
    return document.querySelectorAll('[jsname="dTKtvb"]')
  }

  static get chatInput() {
    return waitForSelector('[jsname="vERSO"] textarea')
  }

  static async toggleMicrophone(turnOff = null) {
    const selector = '[jscontroller="t8kvj"] [jsname="BOHaEe"]'
    const microphone = await waitForSelector(selector)

    if (turnOff == null) {
      microphone?.click()
      return microphone
    }

    const isMuted = microphone?.dataset?.isMuted !== 'false'

    if (turnOff) {
      if (!isMuted) microphone?.click()
    } else {
      if (isMuted) microphone?.click()
    }

    return microphone
  }

  static async toggleCamera(turnOff = null) {
    const selector = '[jscontroller="DXtw0b"] [jsname="BOHaEe"]'
    const camera = await waitForSelector(selector)
    
    if (turnOff == null) {
      camera?.click()
      return camera
    }

    const isMuted = camera?.dataset?.isMuted !== 'false'

    if (turnOff) {
      if (!isMuted) camera?.click()
    } else {
      if (isMuted) camera?.click()
    }

    return camera
  }

  static get navigationBar() {
    return document.querySelector('[jsname="EaZ7Cc"]')
  }

  static fixNavigationBar(fix = true) {
    if (fix) document.body.classList.add('fijarBarraLlamada')
    else document.body.classList.remove('fijarBarraLlamada')
  }

  static async cancelCall(closeRoomForAll = false) {
    const cancelButton = document.querySelector('[jsname="CQylAd"]')
    cancelButton.click()

    // if user is Admin, a dialog will show
    const dialog = await waitForSelector('[jscontroller="N5Lqpc"]')

    const buttons = dialog.querySelectorAll('[jscontroller="VXdfxd"] .ZFr60d.CeoRYc')

    if (!closeRoomForAll) buttons[0].click()
    else buttons[1].click()
  }

  // Modifica o añade en caso de que no exista el <meta name="theme-color">
  static changeMetaThemeColor(color = '#3f8577') {
    const metaThemeColor = document.querySelector('meta[name="theme-color"]') ?? document.createElement('meta');
    metaThemeColor.name = "theme-color";
    metaThemeColor.content = color;

    document.head.append(metaThemeColor)
  }

  static changeMetaColorScheme(mode = 'dark') {
    const metaColorScheme = document.querySelector('meta[name="color-scheme"]') ?? document.createElement('meta');
    metaColorScheme.name = "color-scheme";
    metaColorScheme.content = mode;

    document.head.append(metaColorScheme);
  }


  static get progressFileBar() {
    return document.querySelector('#file-upload-progress')
  }

  static get progressContainer() {
    return document.querySelector('#progress-container')
  }

  static #isStreaming = false
  static #isReadingStream = false

  static fileName = ''
  static fileSize = ''

  // Interval id
  static readingStream
  static readingFileStream

  // Contains the file obtain by reading the stream
  static fileStreamReadResult = ''

  // Stream files in the chat
  static async streamData() {

    if (Meet.#isReadingStream) {
      showPopup('Cannot stream data while already reading an stream', 3000)
      throw new Error('Cannot stream data while already reading an stream')
    } else if (Meet.#isStreaming) {
      showPopup("There's already an stream in process", 3000)
      throw new Error("There's already an stream in process")
    }

    /**
     * @type {[FileSystemFileHandle]}
     */
    const [fileSystemFileHandle] = await window.showOpenFilePicker()
    const file = await fileSystemFileHandle.getFile()

    clearInterval(Meet.readingStream)

    Meet.#isStreaming = true

    const dataURL = await readFileAs(file, 'dataURL')

    const delayPerChunk = 210

    let streamPointer = 0

    // Handle time left
    let startTime = Date.now()
    let counter = 1


    // Send file name as 1st message
    const initialMessage = `$$@ Name: ${file.name} !|! Size: ${dataURL.length} $$@`;
    console.string(initialMessage);

    await Meet.sendMessage(initialMessage).then(message => message.remove())

    const streamFileData = async function() {

      Meet.progressFileBar.dataset.state = 'upload'

      const chunkSize = (await Meet.chatInput).maxLength * 0.8

      const start = streamPointer
      let end   = streamPointer + chunkSize
      if (end >= dataURL.length) end = dataURL.length

      const chunk = dataURL.slice(start, end)

      // Handle time left
      const now = Date.now() - startTime

      const chunkAVGTime = now / (chunk.length * counter)
      const totalAVGTime = chunkAVGTime * dataURL.length

      const timeLeft = new Date(totalAVGTime - now)

      let seconds = timeLeft.getSeconds()
      const minutes = timeLeft.getMinutes()

      counter++


      const streamPrefix = '$$@'
      const streamSufix  = '$$@'

      // NOTE: FIX INVALID SELECTOR DUE TO BREAK LINE CHARACTER
      const message = `${streamPrefix} ${chunk} ${streamSufix}`


      // Progress Bar
      Meet.progressContainer.querySelector('#file-name').innerHTML = `${file.name}`
      Meet.progressContainer.querySelector('#progress-file').innerHTML = `(${end} / ${dataURL.length}) ${minutes}min ${seconds}s`
      Meet.progressFileBar.min = 0
      Meet.progressFileBar.value = end
      Meet.progressFileBar.max = dataURL.length


      // Send chunk
      Meet.sendMessage(message).then(message => {
        deleteChunksFromChat()
      })


      // console.string(message)
      streamPointer += chunkSize

      // End when streamPointer is out of range
      if (streamPointer >= dataURL.length) {
        // Delete chunk message from the chat

        // Restart reading
        Meet.#isStreaming = false
        Meet.readingStream = setInterval(Meet.readStreamData, 1000 / 60)
        return
      }


      // 'setTimeout' en lugar de 'setInterval' para garantizar el orden de ejecución
      streaming = setTimeout(() => streamFileData(dataURL), delayPerChunk)

    }


    let streaming = setTimeout(() => streamFileData(dataURL), delayPerChunk)

    function deleteChunksFromChat() {
      // document.querySelectorAll('.file-chunk').forEach(chunkMessage => chunkMessage.remove())
      // document.querySelectorAll('[jsname="Ypafjf"]').forEach(r => {
      //   if (r.querySelector('[jsname="h83qlf"]')?.childElementCount === 0) r.remove()
      // })

      Meet.chatMessages.forEach(message => {
        const streamMessageValidation = /^\$\$@ .* \$\$@$/
        const messageText = message.dataset.messageText

        if ( streamMessageValidation.test(messageText) ) message.remove()
      })

      document.querySelectorAll('[jsname="Ypafjf"]').forEach(r => {
        if (r.querySelector('[jsname="h83qlf"]')?.childElementCount === 0) r.remove()
      })
    }

  } // streamData()

  static readStreamData() {

    if (Meet.#isReadingStream) {
      showPopup('Cannot read stream data while already reading an stream', 3000)
      throw new Error('Cannot read stream data while already reading an stream')
    } else if (Meet.#isStreaming) {
      showPopup("There's already an stream in process", 3000)
      throw new Error("There's already an stream in process")
    }

    Meet.progressFileBar.dataset.state = 'download'



    Meet.chatMessages.forEach(message => {

      const initialStreamMessageValidation = /^\$\$@ Name: .* !|! Size: .* \$\$@$/
      const messageText = message.dataset.messageText
      // console.log(messageText)
      Meet.fileName = messageText.slice(messageText.search(/Name: /) + 6, messageText.search(/ !\|!/))
      Meet.fileSize = parseInt( messageText.slice(messageText.search('Size: ') + 6, -4) )

      if ( initialStreamMessageValidation.test(messageText) ) {
        console.log(messageText)

        Meet.fileStreamReadResult = '' // Clear data
        Meet.progressContainer.querySelector('#file-name').innerHTML = Meet.fileName
        Meet.progressContainer.querySelector('#progress-file').innerHTML = `(0 / ${Meet.fileSize})`

        clearInterval(Meet.readingStream)
        Meet.readingFileStream = setInterval(readStreamFileData, 1000 / 60)

        Meet.#isReadingStream = true

        message.remove()

        throw 'End forEach'
      }

    })


    async function readStreamFileData() {

      Meet.chatMessages.forEach(message => {

        const streamMessageValidation = /^\$\$@ .* \$\$@$/
        const messageText = message.dataset.messageText

        if ( streamMessageValidation.test(messageText) ) {
          const chunk = messageText.slice(4, -4)
          Meet.fileStreamReadResult += chunk
          Meet.progressContainer.querySelector('#progress-file').innerHTML = `(${Meet.fileStreamReadResult.length} / ${Meet.fileSize})`

          Meet.progressFileBar.min = 0
          Meet.progressFileBar.value = Meet.fileStreamReadResult.length
          Meet.progressFileBar.max = Meet.fileSize

          message.remove()

          document.querySelectorAll('[jsname="Ypafjf"]').forEach(r => {
            if (r.querySelector('[jsname="h83qlf"]')?.childElementCount === 0) r.remove()
          })
        }

      })


      if (Meet.fileStreamReadResult.length >= Meet.fileSize) {
        clearInterval(Meet.readingFileStream)
        Meet.#isReadingStream = false

        const blob = await fetch(Meet.fileStreamReadResult).then(response => response.blob())
        downloadFile(blob, Meet.fileName)

        Meet.readingStream = setInterval(Meet.readStreamData, 1000 / 60)
      }

    } // readStreamFileData()

  } // readStreamData()

} // class Meet

