// Función personalizada que añade estilos en linea
// a los elementos HTML a partir de un objeto

CSSStyleDeclaration.prototype.setProperties = function(declarations) {

  Object.entries(declarations).forEach(declaration => {
    this.setProperty(
      declaration[0],
      `${declaration[1]}`.replace(/!important/i, ''),
      `${declaration[1]}`.search(/!important/i) !== -1 ? 'important': ''
    )
  })

}




