/* Deshabilitar la pausa de los videos */
function VideosOnPause() {

  videos = document.querySelectorAll('video, iframe.Sonic-2006');

  for(let i in videos) {
      if(videos.length > 0 && videos[i] != videoStream) {

        videos[i].onclick = function(event) { // Evitar que el click pause los videos
          event.preventDefault();
        }


        videos[i].parentElement.parentElement.ondblclick = function(event) { // Hacer que doble click ponga y quite la pantalla completa en los videos

          if(!document.fullscreen) {
            videos[i].parentElement.parentElement.requestFullscreen();
          } else {
            document.exitFullscreen();
          }

        }

        videos[i].parentElement.parentElement.addEventListener("wheel", Resize);
        videos[i].parentElement.parentElement.addEventListener("wheel", Rotate);
        // videos[i].parentElement.parentElement.addEventListener("mousemove", Translate);
        videos[i].parentElement.parentElement.addEventListener("mousedown", ResetTransformation);
        videos[i].parentElement.parentElement.addEventListener("mousedown", getMousePosition);
        document.addEventListener("mousemove", Translate);

      }
  }

}







