let stream
let recorder

async function RecordScreen() {

  stream = await navigator.mediaDevices.getDisplayMedia({video: true, audio: true});

  recorder = new MediaRecorder(stream, {mimeType: 'video/webm'});

  const blobData = [];

  recorder.ondataavailable = event => blobData.push(event.data);

  recorder.start();

  recorder.onstop = function() {
    const urlBlob = URL.createObjectURL(blobData[0]);
    //open(urlBlob,"newWindow");
    videoStream.src = urlBlob;
    videoStream.currentTime = 99999999999999999999999999999999999; // Hacer que el video se visualice correctamente
    setTimeout(() => {videoStream.currentTime = 0}, 1000);
    videoStream.controls = 'controls';
  }

}


function StopRecord() {
  recorder.stop();
  stream.getTracks().forEach( track => track.stop() )
}






