// Función que convierte los mensajes Base64 a texto si empiezan '#|' y acaban en '|#'
function codeChatBase64ToText() {

  chatMessages = document.querySelectorAll('.oIy2qc');
  textPopup = document.querySelectorAll('.mVuLZ.xtO4Tc');

  for(let i = 0; i < chatMessages.length; i++) {

    if(
      chatMessages[i].childNodes[0] != undefined
      && chatMessages[i].childNodes[0].nodeValue != null
      && chatMessages[i].childNodes[0].nodeValue.slice(0,2) == '#|'
      && chatMessages[i].childNodes[0].nodeValue.slice(-2) == '|#'
    ) {
      if(base64regex.test(chatMessages[i].childNodes[0].nodeValue.slice(2,-2))) {
        chatMessages[i].childNodes[0].nodeValue = base64ToText(chatMessages[i].childNodes[0].nodeValue.slice(2,-2));
        chatMessages[i].style.background = '#111';
      }
    }

  }

  // Decodificación de los mensajes de los popups
  for(let i = 0; i < textPopup.length; i++) {

    if(textPopup[i].childNodes[0] != undefined && textPopup[i].childNodes[0].nodeValue != null && textPopup[i].childNodes[0].nodeValue.slice(0,2) == '#|' && textPopup[i].childNodes[0].nodeValue.slice(-2) == '|#') {
      if(base64regex.test(textPopup[i].childNodes[0].nodeValue.slice(2,-2))) {
        textPopup[i].childNodes[0].nodeValue = base64ToText(textPopup[i].childNodes[0].nodeValue.slice(2,-2));
        textPopup[i].style.background = '#111';
      }
    }

  }

  requestAnimationFrame(codeChatBase64ToText)

}



