// Comprobar si la url es una imagen
function isImgLink(url) {
    if(typeof url !== 'string') return false;
    return (url.match(/^http[^\?]*.(jpg|jpeg|gif|png|tiff|bmp|webp|svg)(\?(.*))?/gmi) != null) || url.startsWith('blob:');
}


