// Modificación de URL para transformar la URL de un video de Youtube en su versión para 'iframe'
function ChangeURLToYTEmbed(url) {

  url = url.replace("watch?v=","embed/");
  if(url.includes('&')) {
    url = url.replace(url.slice(url.search('&')),''); // Buscar simbolo '&', seleccionar texto de ahí en adelante y eliminar ese texto
  }

  return url;

}

function ChangeURLToTwitterEmbed(url) {

  let id = '&id=' + url.slice(url.search('/status/') + 8, url.length);;

  let theme = '&theme=dark';
  let lang = '&lang=es';

  let newURL = 'https://platform.twitter.com/embed/Tweet.html?' + id + theme + lang;

  return newURL;

}

function ChangeURLToCodePenEmbed(url) {

  let id = url.slice(url.search('/pen/') + 5, url.length);
  let user = url.slice( url.search('codepen.io/') + 11, url.search('/pen/') );

  let theme = '&theme-id=dark';

  let newURL = 'https://codepen.io/'+user+'/embed/preview/'+id+'?' + theme;

  return newURL;

}




